// Path: frontend/src/admin/pages/users/UserCart.jsx
import { FiShoppingCart, FiEdit, FiTrash2, FiChevronLeft } from 'react-icons/fi';
import { Link, useParams } from 'react-router-dom';

export default function UserCart() {
  const { userId } = useParams(); // Get user ID from URL
  
  const fetchCart = async () => {
        try {
                const response = await fetch(`http://localhost:5000/api/cart/${userId}`, {
                        method: "GET",
                        headers: {
                                "Content-Type": "application/json",
                                Authorization: `Bearer ${token}`,
                        },
                });

                const data = await response.json();

                if (response.ok) {
                        setCartItems(data.products || []);
                } else {
                        setError(data.message || "Failed to load cart.");
                }
        } catch (err) {
                console.error("Fetch error:", err);
                setError("Server error while fetching cart.");
        } finally {
                setLoading(false);
        }
};



  // Mock data - replace with API call
  const user = {
    id: userId || 'usr_01',
    name: 'Emma Johnson',
    cartItems: 3,
    totalAmount: '$1,245.00'
  };

  const cartProducts = [
    {
      id: 'prod_101',
      name: 'Diamond Solitaire Ring',
      price: '$999.00',
      quantity: 1,
      finalPrice: '$999.00'
    },
    {
      id: 'prod_205',
      name: 'Rose Gold Bracelet',
      price: '$245.00',
      quantity: 2,
      finalPrice: '$490.00'
    }
  ];

  return (
    <div className="p-6 bg-rose-25 ml-64">
      {/* Header with back button */}
      <div className="mb-6">
        <Link 
          to={`/admin/users`}
          className="flex items-center gap-2 text-amber-900 hover:text-rose-800"
        >
          <FiChevronLeft /> Back to Users
        </Link>
      </div>

      {/* User Summary */}
      <div className="bg-white rounded-xl shadow-sm border border-rose-100 p-6 mb-8">
        <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
          <div>
            <p className="text-sm text-amber-900/80">User ID</p>
            <p className="font-medium text-rose-800">{user.id}</p>
          </div>
          <div>
            <p className="text-sm text-amber-900/80">Name</p>
            <p className="font-medium text-rose-800">{user.name}</p>
          </div>
          <div>
            <p className="text-sm text-amber-900/80">Items in Cart</p>
            <p className="font-medium text-rose-800">{user.cartItems}</p>
          </div>
          <div>
            <p className="text-sm text-amber-900/80">Total Amount</p>
            <p className="font-medium text-rose-800">{user.totalAmount}</p>
          </div>
        </div>
      </div>

      {/* Cart Products Table */}
      <div className="bg-white rounded-xl shadow-sm border border-rose-100 overflow-hidden">
        <table className="min-w-full divide-y divide-rose-100">
          <thead className="bg-rose-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Product ID</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Name</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Price</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Quantity</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Final Price</th>
              <th className="px-6 py-3 text-right text-xs font-medium text-amber-900 uppercase tracking-wider">Actions</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-rose-50">
            {cartProducts.map((product) => (
              <tr key={product.id} className="hover:bg-rose-50/50">
                <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-rose-800">{product.id}</td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-amber-900">{product.name}</td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-amber-900">{product.price}</td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-amber-900">{product.quantity}</td>
                {/* <td className="px-6 py-4 whitespace-nowrap text-sm text-amber-900">
                  <select 
                    defaultValue={product.quantity}
                    className="border border-rose-200 rounded px-2 py-1 text-sm"
                  >
                    {[1, 2, 3, 4, 5].map(num => (
                      <option key={num} value={num}>{num}</option>
                    ))}
                  </select>
                </td> */}
                <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-rose-800">{product.finalPrice}</td>
                <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium space-x-2">
                  <button className="text-amber-600 hover:text-amber-800">
                    <FiEdit />
                  </button>
                  <button className="text-rose-600 hover:text-rose-800">
                    <FiTrash2 />
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
